import { createContext } from "react";
import { MenuEnum } from '../Enums/MenuEnums'

let defaultValue = {
    setState: (newState: MenuEnum) => console.log('[eq]'),
    state: MenuEnum.Brands
}

const WorkingSpaceContext = createContext(defaultValue)

export default WorkingSpaceContext
